// src/pages/Contact.js
import React from 'react';
import ContactForm from '../components/ContactForm';
import './Contact.css';

const Contact = () => {
  return (
    <div className="contact">
      <h1>Contact Me</h1>
      <ContactForm />
    </div>
  );
};

export default Contact;
